description:
Magazine mogul Hugh Heffer sends our pal Ginger on a sex-sizzling search through San Francisco's infamous Tenderloin District. It seems that Mr. Heffer is looking for a missing enchantress who is &quot;The best cocksucker I ever knew,&quot; and the only clue he can give Ginger is that the mystery lady has a butterfly tattoo on her left butt cheek. Never So Deep will tickle your funny bone, as well as your fancy. Damiano, master of the erotic, saves the mystery lady for last, and what a cherry she is to top this cream-filled exotic dessert. You'll be glad you went so far down.

